import React from 'react';
import logo from 'src/assets/images/logo.svg';

import { StyledHeader, Logo } from './styles';

const Header = () => (
	<StyledHeader>
		<Logo>
    <img src={logo} alt="rick and morty"/>
		</Logo>
  </StyledHeader>
);

export default Header;
